import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Navbar, Button } from 'react-bootstrap';

const mapStateToProps = (state) => {
  return { counter: state.counter };
};
const mapDispatchToProps = (dispatch) => {
  return {
    onSave: () => dispatch({ type: 'SAVE' }),
	onLoad: () => dispatch({ type: 'LOAD' }),
	onGenerate: () => dispatch({ type: 'GENERATE' }),
	onClear: () => dispatch({ type: 'CLEAR' }),
	on: () => dispatch({ type: 'LOAD' }),
    onLoad: () => dispatch({ type: 'LOAD' }),
  }
};

class Navigation extends Component {
	render() {
		const { counter, onSave, onLoad } = this.props;

		return ( <>
			<Navbar bg="light">
				<Button className="mr-4" variant="outline-warning" onClick={ null } ><b> Ustawienia </b></Button>
				<Button className="mr-2" variant="outline-dark" onClick={ null } ><b> Zapisz </b></Button>
				<Button className="mr-4" variant="outline-dark" onClick={ null } ><b> Wczytaj </b></Button>
				<Button className="mr-2" variant="outline-success" onClick={ null } ><b> Generuj </b></Button>
				<Button className="mr-4" variant="outline-danger" onClick={ null } ><b> Wyczyść </b></Button>
				<Button className="mr-2" variant="outline-info" onClick={ null } ><b>
					Pokaż absencje
				</b></Button>
				<Button className="mr-4" variant="outline-info" onClick={ null } ><b>
					Pokaż czas pracy
				</b></Button>
				<Button className="mr-2" variant="outline-dark" onClick={ null } ><b> Cofnij </b></Button>
				<Button className="mr-2" variant="outline-dark" onClick={ null } ><b> Przywróć </b></Button>
			</Navbar>
		</> );
	}
}

export default Navigation = connect(mapStateToProps, mapDispatchToProps)(Navigation);
